import { ADD_QUESTION, RECEIVE_QUESTIONS } from "./types";

export const addQuestion = (questions) => {
    return {
        type: ADD_QUESTIONS,
        questions
    }
}

export const receiveQuestions = (questions) => {
    return {
        type: RECEIVE_QUESTIONS,
        questions
    }
}
